struct Solution {}

impl Solution {
    pub fn two_sum(nums: Vec<i32>, target: i32) -> Vec<i32> {
        let mut index: Vec<i32> = Vec::new();
        for i in 0..nums.len() {
            index.push(i as i32);
        }
        index.sort_by_key(|x| { nums[*x as usize] });
        let mut j = (nums.len() - 1) as i32;
        let mut i = 0;
        while i < j {
            let x = nums[index[i as usize] as usize];
            let y = nums[index[j as usize] as usize];
            if x + y > target {
                j -= 1;
            } else if x + y < target {
                i += 1;
            } else {
                return vec!(index[i as usize], index[j as usize]);
            }
        }
        unreachable!()
    }
}

fn main() {
    let ans = Solution::two_sum(vec![2, 7, 11, 15], 9);
    println!("{:?}", ans);
}

// Definition for singly-linked list.
#[derive(PartialEq, Eq, Clone, Debug)]
pub struct ListNode {
    pub val: i32,
    pub next: Option<Box<ListNode>>,
}

struct Solution;

impl ListNode {
    #[inline]
    fn new(val: i32) -> Self {
        ListNode {
            next: None,
            val,
        }
    }
}

fn vec2list(v: Vec<i32>) -> Option<Box<ListNode>> {
    let mut head = Some(Box::new(ListNode::new(v[0])));
    let mut h = &mut head;
    for i in 1..v.len() {
        let node = h.as_deref_mut().unwrap();
        node.next = Some(Box::new(ListNode::new(v[i])));
        h = &mut node.next;
    }
    return head;
}

fn list2string(li: &Option<Box<ListNode>>) -> String {
    let mut s: String = "".to_string();
    let mut i = li;
    loop {
        if i.is_none() {
            break;
        }
        let ii = i.as_deref().unwrap();
        s += &format!("{}", ii.val);
        i = &ii.next;
    }
    return s;
}

fn list2vec(li: &Option<Box<ListNode>>) -> Vec<i32> {
    let mut i = li;
    let mut a = Vec::<i32>::new();
    loop {
        if i.is_none() {
            break;
        }
        let ii = i.as_deref().unwrap();
        let x = ii.val;
        a.push(x);
        i = &ii.next;
    }
    return a;
}

fn vec_add(a: Vec<i32>, b: Vec<i32>) -> Vec<i32> {
    let mut c = Vec::<i32>::new();
    let mut enter = 0;
    let end = if a.len() > b.len() { a.len() } else { b.len() };
    for i in 0..end {
        let x = if i >= a.len() { 0 } else { a[i] };
        let y = if i >= b.len() { 0 } else { b[i] };
        let val = x + y + enter;
        enter = val / 10;
        c.push(val % 10);
    }
    if enter > 0 {
        c.push(enter);
    }
    return c;
}

impl Solution {
    pub fn add_two_numbers(l1: Option<Box<ListNode>>, l2: Option<Box<ListNode>>) -> Option<Box<ListNode>> {
        let mut a = list2vec(&l1);
        // a.reverse();
        let mut b = list2vec(&l2);
        // b.reverse();
        let mut c = vec_add(a, b);
        // c.reverse();
        return vec2list(c);
    }
}

fn main() {
    let l1 = vec2list(vec!(2, 4, 3));
    let l2 = vec2list(vec!(5, 6, 4));
    let ans = Solution::add_two_numbers(l1, l2);
    println!("{}", list2string(&ans));
}

use std::collections::{HashMap};

struct Solution;

impl Solution {
    pub fn length_of_longest_substring(s: String) -> i32 {
        if s.len() == 0 {
            return 0;
        }
        let mut a = HashMap::<char, usize>::new();
        let mut i = 0usize;
        let mut ans = 0usize;
        let chars: Vec<char> = s.chars().collect();
        for j in 0..chars.len() {
            let c = &chars[j];
            if a.contains_key(c) {
                let pos = *a.get(c).unwrap();
                while i <= pos {
                    a.remove(&chars[i]);
                    i += 1;
                }
            }
            a.insert(*c, j);
            let len = j - i + 1;
            // println!("s[{}]={} len={} i={}", j, c, len, i);
            if ans < len {
                ans = len;
            }
        }
        return ans as i32;
    }
}

fn main() {
    let ans = Solution::length_of_longest_substring("a".to_string());
    println!("{}", ans);
}

struct Solution;

const MAX: i32 = (1 << 30) - 1;

fn min(a: i32, b: i32) -> i32 {
    if a < b { a } else { b }
}

fn max(a: i32, b: i32) -> i32 {
    if a > b { a } else { b }
}

fn get(a: &Vec<i32>, ind: i32) -> i32 {
    //使用哨兵单元作为最后元素，这样两个数组都不会遇到结尾
    if ind as usize >= a.len() {
        return MAX;
    } else {
        return a[ind as usize];
    }
}

fn get_nth(a: &Vec<i32>, b: &Vec<i32>, n: i32) -> i32 {
    //寻找第n个元素
    let mut i: i32 = -1;
    let mut j: i32 = -1;
    loop {
        // println!("i={},j={},target={}", i, j, n);
        if i + j + 1 == n {
            //找到了第n个元素
            if j == -1 {
                return a[i as usize];
            }
            if i == -1 {
                return b[j as usize];
            }
            return max(a[i as usize], b[j as usize]);
        }
        let mut dis = (n - i - j - 1) / 2;
        if dis == 0 {
            //最少移动1步，防止剩下2步的时候原地踏步
            dis = 1;
        }
        let x = get(&a, i + dis);
        let y = get(&b, j + dis);
        //两者让小的那一个前进
        if x < y {
            i += dis;
        } else {
            j += dis;
        }
    }
}

impl Solution {
    pub fn find_median_sorted_arrays(nums1: Vec<i32>, nums2: Vec<i32>) -> f64 {
        let l = nums2.len() + nums1.len();
        if l % 2 == 0 {
            let x = get_nth(&nums1, &nums2, (l / 2) as i32);
            let y = get_nth(&nums1, &nums2, (l / 2 - 1) as i32);
            // println!("found even {} {}", x, y);
            return (x + y) as f64 / 2.0;
        } else {
            let x = get_nth(&nums1, &nums2, (l / 2) as i32);
            // println!("found odd {}", x);
            return x as f64;
        }
        unreachable!();
    }
}

fn main() {
    let res = Solution::find_median_sorted_arrays(vec![0, 0], vec!(0, 0));
    println!("{}", res);
}

