    if i + 1 < a.len() as i32 && a[i as usize] == one && a[(i + 1) as usize] == ten {
        return (i + 2, 9 * base);
    }
    if i + 1 < a.len() as i32 && a[i as usize] == one && a[(i + 1) as usize] == five {
        return (i + 2, 4 * base);
    }
    let mut j = i;
    let mut s = 0;
    while j < a.len() as i32 {
        if a[j as usize] == five {
            s += 5 * base;
        } else if a[j as usize] == one {
            s += base;
        } else {
            break;
        }
        j += 1;
    }
    return (j, s);
}

