public boolean dfs(char[][] board) {
    for (int i = 0; i < 9; i++) {
        for (int j = 0; j < 9; j++) {
            if(board[i][j] != '.') {
                continue;
            }

            for (int k = 1; k <= 9; k++) {
                board[i][j] = (char)(k + '0');
                if(isValid(board, i, j) && dfs(board)) {
                    return true;
                }
                board[i][j] = '.';
            }

