                let up = grid[i][j] + if i > 0 { a[i - 1][j] } else { 1 << 30 };
                let left = grid[i][j] + if j > 0 { a[i][j - 1] } else { 1 << 30 };
                a[i][j] = min(up, left);
            }
        }
        a[rows - 1][cols - 1]
    }
}

